import React from "react";

export class AdminComponent extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            info: JSON.parse(sessionStorage.getItem("project1_data"))
        }
        console.log(this.state);
        console.log(document.cookie.split(""))

    }

    getUsers(){
        fetch("http://localhost:8080/project1/getUsers",{
            method:"GET",
            body: ""
        });
    }


    capitalizeFirstLetter(string) {
        return string.charAt(0).toUpperCase() + string.slice(1);
    }


    render(){
        return(
            <>
                <div>
                    <nav class="navbar navbar-expand-lg navbar-light bg-light">
                        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarTogglerDemo03" aria-controls="navbarTogglerDemo03" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                        </button>
                        <a class="navbar-brand">Hello {this.capitalizeFirstLetter(this.state.info.firstName)}</a>

                        <div class="collapse navbar-collapse" id="navbarTogglerDemo03">
                        <ul class="navbar-nav mr-auto mt-2 mt-lg-0">
                            <li class="nav-item active">
                                <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link" href="#">Add User</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link disabled" href="#">Remove User</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link disabled" href="#">Log Out</a>
                            </li>
                        </ul>
                        </div>
                    </nav>
                </div>
            </>
        )
    }
}
